const ezcastList=document.getElementById("ezcastList");const configList=document.getElementById("configList");getEZCasts();getSharedConfigs();function onEZCastsLoaded(b){ezcastList.innerHTML="";if(b.length==0){ezcastList.innerHTML+='<span class="list-item"><i class="device list-icon"></i>No EZCasts found</span>'}else{for(var a=0;a<b.length;a++){ezcastList.innerHTML+='<a class="list-item" href="/pages/device.php?id='+b[a]._id+'"><i class="device list-icon"></i>'+b[a].name+"</a>"}}}function onSharedConfigsLoaded(b){configList.innerHTML="";if(b.length==0){configList.innerHTML+='<span class="list-item"><i class="config list-icon"></i>No Shared Configs found</span>'}else{for(var a=0;a<b.length;a++){configList.innerHTML+='<a class="list-item" href="/pages/config.php?id='+b[a]._id+'"><i class="config list-icon"></i>'+b[a].configName+"</a>"}}};